import { HttpClient } from '@angular/common/http';
import { Injectable } from '@angular/core';
import { Observable } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class CarListService {

  constructor(private http: HttpClient) { }

  carList: CarList[] = [];

  getCarList(): Observable<carList[]> {
    return this.http.get<any[]>('https://gta.vercel.app/api/vehicles/all');
  }

  getCarName(id: number): Observable<any> {
    return this.http.get<any>('https://gta.vercel.app/api/vehicles/' + id);
  }

  getCarImage(id: number): Observable<any> {
    return this.http.get<any>('https://gta.vercel.app/api/vehicles/' + id + '/image');
  }
}
